import React from "react";
import Logo from "../img/logo_fisei.png";

const Footer = () => {
  return (
    <footer>
      <img src={Logo} alt="" />
      <span>
        <b>Brito - Cayo - Changoluisa - Granda</b>
      </span>
    </footer>
  );
};

export default Footer;
